import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [orderNumber, setOrderNumber] = useState('');
  const [name, setName] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [deliveryAddress, setDeliveryAddress] = useState('');
  const [deliveryDate, setDeliveryDate] = useState('');
  const [error, setError] = useState('');
  const [successMessage, setSuccessMessage] = useState('');
  const [deliveries, setDeliveries] = useState([]);

  useEffect(() => {
    fetch('http://localhost:5000/api/deliveries')
      .then(response => response.json())
      .then(data => setDeliveries(data))
      .catch(error => console.error('Error fetching deliveries:', error));
  }, []);

  const validateDeliveryDate = (date) => {
    const now = new Date();
    const selectedDate = new Date(date);
    const maxAdvanceDate = new Date(now);
    maxAdvanceDate.setDate(maxAdvanceDate.getDate() + 3);

    const nextDay11AM = new Date(now);
    nextDay11AM.setDate(nextDay11AM.getDate() + 1);
    nextDay11AM.setHours(11, 0, 0, 0);

    const fifteenHoursBeforeNextDay11AM = new Date(nextDay11AM);
    fifteenHoursBeforeNextDay11AM.setHours(nextDay11AM.getHours() - 15);

    if (selectedDate > maxAdvanceDate || selectedDate < now) {
      return 'You can only schedule deliveries within 3 days in advance.';
    }

    if (now >= fifteenHoursBeforeNextDay11AM && selectedDate.getDate() === nextDay11AM.getDate()) {
      return 'You cannot schedule a delivery for the next day if it is less than 15 hours to 11 AM.';
    }

    const deliveriesOnSelectedDate = deliveries.filter(
      delivery => new Date(delivery.deliveryDate).toDateString() === selectedDate.toDateString()
    );

    if (deliveriesOnSelectedDate.length >= 8) {
      return 'There are already 8 deliveries scheduled for this day. Please choose another day.';
    }

    return '';
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    const validationError = validateDeliveryDate(deliveryDate);

    if (validationError) {
      setError(validationError);
    } else if (!orderNumber || !name || !phoneNumber || !deliveryAddress || !deliveryDate) {
      setError('All fields are required.');
    } else {
      setError('');
      setSuccessMessage('');
      // Send data to the server
      fetch('http://localhost:5000/api/submit', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ 
          orderNumber,
          name,
          phoneNumber,
          deliveryAddress,
          deliveryDate
        }),
      })
      .then(response => response.json())
      .then(data => {
        console.log('Success:', data);
        setSuccessMessage('Order details submitted successfully!');
        setDeliveries([...deliveries, { deliveryDate }]); // Update deliveries list
      })
      .catch((error) => {
        console.error('Error:', error);
        setError('Error submitting order details.');
      });
    }
  };

  const handleDeliveryDateChange = (e) => {
    const date = e.target.value;
    const validationError = validateDeliveryDate(date);
    if (validationError) {
      setError(validationError);
    } else {
      setError('');
      setDeliveryDate(date);
    }
  };

  return (
    <div className="App">
      <form onSubmit={handleSubmit}>
        <label htmlFor="orderNumber">Order #*</label>
        <input
          type="text"
          id="orderNumber"
          value={orderNumber}
          onChange={(e) => setOrderNumber(e.target.value)}
        />

        <label htmlFor="name">Name*</label>
        <input
          type="text"
          id="name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />

        <label htmlFor="phoneNumber">Phone Number*</label>
        <input
          type="text"
          id="phoneNumber"
          value={phoneNumber}
          onChange={(e) => setPhoneNumber(e.target.value)}
        />

        <label htmlFor="deliveryAddress">Delivery Address*</label>
        <input
          type="text"
          id="deliveryAddress"
          value={deliveryAddress}
          onChange={(e) => setDeliveryAddress(e.target.value)}
        />

        <label htmlFor="deliveryDate">Delivery Date*</label>
        <input
          type="date"
          id="deliveryDate"
          value={deliveryDate}
          onChange={handleDeliveryDateChange}
        />

        {error && <div className="error">{error}</div>}
        {successMessage && <div className="success">{successMessage}</div>}
        <button type="submit">NEXT â†’</button>
      </form>
    </div>
  );
}

export default App;
